import Img from '../components/images/profile.png';
function Hero() {
  return (
    <section className="hero w-60 py-5">
      <div className="container row">
        <div className="col-lg-7 col-md-12 col-sm-12 p-0">
          <h1 className="pt-5 pb-2">Ayaan Malik</h1>
          <p>Wassim is an engineer and thought leader working on helping developers build a faster Web. Wassim loves teaching about the Web Platform, Cloud technologies and JavaScript</p>
        </div>
        <div className="col-lg-5 col-md-12 col-sm-12 p-0 align-item-center">
          <img className='profile ' src= {Img} alt='Profile'/>
        </div>
      </div>
    </section>
  );
}

export default Hero;
